import gql from "graphql-tag";

export const TEAM_FRAGMENT = gql`
  fragment TeamParts on Team {
    id
    name
    users {
      fullName
    }
  }
`;

export const GET_TEAMS = gql`
  query getTeams {
    teams {
      id
      name
      users {
        fullName
      }
    }
  }
`;

export const GET_TEAM = gql`
  query getTeams($id: ID!) {
    team(id: $id) {
      id
      name
      users {
        fullName
      }
    }
  }
`;
